import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {title: 'Health Insurance', amount: 927.53, date: new Date(2023, 9, 14)},
    {title: 'Car Insurance', amount: 1200.00, date: new Date(2023, 9, 14)},
    {title: 'Toilet Paper', amount: 228.45, date: new Date(2023, 9, 14)},
    {title: 'Mobile Recharge', amount: 450.69, date: new Date(2023, 9, 14)},
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>JSX is JavaScript XML</p>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
